/*Table structure for table `acw_health` */

DROP TABLE IF EXISTS `acw_health`;

CREATE TABLE `acw_health` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `height` decimal(4,1) DEFAULT NULL COMMENT '身高',
  `weight` decimal(3,1) DEFAULT NULL COMMENT '体重',
  `smoke` int(11) DEFAULT NULL COMMENT '吸烟习惯',
  `drinking` int(11) DEFAULT NULL COMMENT '饮酒习惯',
  `sleep_duration` int(11) DEFAULT NULL COMMENT '睡眠市场',
  `execise_habits` int(11) DEFAULT NULL COMMENT '运动习惯',
  `taste_preference` int(11) DEFAULT NULL COMMENT '口味偏好',
  `remarks` varchar(200) DEFAULT NULL COMMENT '其他',
  `blood_pressure_state` int(11) DEFAULT NULL COMMENT '状态(0正常,1偏低,2偏高,3超高)',
  `activity_ability` int(11) DEFAULT NULL COMMENT '活动能力(0正常,1拄拐,2轮椅,3卧床)',
  `self_care` int(11) DEFAULT NULL COMMENT '自理能力(0饮食,1洗澡,2穿衣,3修饰)',
  `mentality` int(11) DEFAULT NULL COMMENT '精神状态(0正常,1痴呆,2抑郁,3暴力)',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人',
  `modified_time` datetime DEFAULT NULL COMMENT '修改时间',
  `modified_by` varchar(50) DEFAULT NULL COMMENT '修改人',
  `is_delete` int(11) DEFAULT NULL COMMENT '伪删除',
  `extend_col_1` varchar(255) DEFAULT NULL COMMENT '扩展1',
  `extend_col_2` varchar(255) DEFAULT NULL COMMENT '扩展2',
  `extend_col_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `extend_col_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `bmi` decimal(4,2) DEFAULT NULL COMMENT 'BMI',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='健康信息';

