/*Table structure for table `acw_user` */

DROP TABLE IF EXISTS `acw_user`;

CREATE TABLE `acw_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `sys_user_id` bigint(20) DEFAULT NULL COMMENT '系统用户ID',
  `real_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `sex` int(11) DEFAULT NULL COMMENT '性别',
  `age` int(11) DEFAULT NULL COMMENT '年龄',
  `card_no` varchar(50) DEFAULT NULL COMMENT '身份证号',
  `phone` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `residential_address` varchar(200) DEFAULT NULL COMMENT '居住地址',
  `permanent_address` varchar(200) DEFAULT NULL COMMENT '户籍地址',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `native_place` varchar(50) DEFAULT NULL COMMENT '籍贯',
  `nation` int(11) DEFAULT NULL COMMENT '民族',
  `state` int(11) DEFAULT NULL COMMENT '状态',
  `photo_url` varchar(255) DEFAULT NULL COMMENT '头像',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '修改人',
  `extend_col_1` varchar(255) DEFAULT NULL COMMENT '扩展1',
  `extend_col_2` varchar(255) DEFAULT NULL COMMENT '扩展2',
  `extend_col_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `extend_col_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=112 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户信息表';

